import React  from "react";
import Heading from "./Core-component/Heading";
const qhead =()=>{
    return(
        <>
        <div className="Quality-wrp container">
            <div className="quality-heading text-center">
            <Heading 
            prefixhead = "Quality"
            />
            </div>
        </div>
        </>
    )
}
export default qhead;
